import { useParams } from "react-router-dom";
import { useEffect } from 'react/cjs/react.development';

function Detail() {
  const { id } = useParams();
  console.log(id);
  useEffect(()=>{
    fetch('https://yts.mx/api/v2/movie_details.json?movie_id=:${id}')
  },[])
  return <div>Detail</div>;
}

export default Detail;
